import React from "react";

export default function CartPage(props){
    return(
        <div >
            <div className="bodycartpage" >
                <div className="row" style={{padding: "20px", minHeight: "500px", maxHeight: "500px"}}>
                    <div className="col-8">Product</div>
                    <div className="col-4" style={{borderLeft: "1px solid darkorange"}}>
                        <button className="btn btn-danger">Thanh Toan</button>
                    </div>
                </div>
            </div>
            <div style={{ bottom:"0px", minHeight:"100px", borderTop: "2px solid darkorange"}} className="footercartpage"></div>
        </div>
    )
}
